import React from "react";
import styled from "styled-components";
import Fade from "react-reveal/Fade";
function FrontData() {
  return (
    <Wrap bgImage="/images/model-s.jpg">
      <Fade bottom>
        <ItemText>
          <h1>Model S</h1>
          <p>Plaid</p>
        </ItemText>
      </Fade>

      <Buttons>
        <ButtonGroup>
          <Mileage>
            <h4></h4>
          </Mileage>
          <SixtySpeed>
            <h4></h4>
          </SixtySpeed>
          <TopSpeed>
            <h4></h4>
          </TopSpeed>
          <PeakPower>
            <h4></h4>
          </PeakPower>
          <RightButton>Order Now</RightButton>
        </ButtonGroup>
      </Buttons>
    </Wrap>
  );
}

const Wrap = styled.div`
  width: 100vw;
  height: 100vh;
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
  background-image: ${(props) => `url("${props.bgImage}")`};
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  align-items: center;
  transform: translateY(100%)
  transition: transform 0.2s ease-in-ease-out;
`;

const ItemText = styled.div`
  padding-top: 15vh;
  text-align: center;
  h1 {
    color: rgb(10, 10, 10);
    font-family: Arial, Verdana, sans-serif;
  }
`;

const ButtonGroup = styled.div`
  display: flex;
  margin-bottom: 30px;
  @media (max-width: 768px) {
    flex-direction: column;
  }
`;
const RightButton = styled.div`
  background-color: rgba(23, 26, 32, 0);
  width: 200px;
  height: 40px;
  color: white;
  display: flex;
  justify-content: center;
  align-items: center;
  border: 2px solid rgb(249, 249, 249);
  border-radius: 100px;
  opacity: 0.85;
  text-transform: uppercase;
  font-size: 12px;
  cursor: pointer;
  margin: 8px;
`;

const Mileage = styled.div``;
const SixtySpeed = styled.div``;
const TopSpeed = styled.div``;
const PeakPower = styled.div``;

const Buttons = styled.div``;

export default FrontData;
